import React from 'react';

function NavTab () {

    const text = 
        {
            id1: 'О проекте',
            id2: 'Технологии',
            id3: 'Студент'
        }

    
    return (
        <section className="NavTab">
            <nav className="NavTab__list">
                    
                        <li className="NavTab__link-list-type">
                            <p className="NavTab__button">
                                <a className="NavTab__button-text" href="#top" >{text.id1}</a>
                            </p>
                        </li>
                        <li className="NavTab__link-list-type">
                            <p className="NavTab__button">
                                <a className="NavTab__button-text" href="#top" >{text.id2}</a>
                            </p>
                        </li>
                        <li className="NavTab__link-list-type">
                        <p className="NavTab__button">
                                <a className="NavTab__button-text" href="#top" >{text.id3}</a>
                            </p>
                        </li>
                    
                </nav>
        </section>
    );
}

export default NavTab;
